import React from 'react'
import { ImgRound } from '../graphics/images'

const Menu = props => {

    let content = (
        <div className="container mx-auto flex m-4">
            <ImgRound className="w-5 h-5" src="/profile.png" />
            <p className="font-sans font-medium text-sm text-gray-900 text-center m-2">
                {props.username}
            </p>
        </div>
    )

    return content
}

export default Menu
